import React from 'react'
const Course = ({course}) => {
  console.log(course);
  return(
    <>
      <Header name={course.name} />
    </>
  )
}

const Header = (name) => {
  console.log(name)
  return (
    <h1>{name.name}</h1>
  )
}



const App = () => {
  const course = {
    id: 1,
    name: "Half Stack application development",
    parts: [
      {
        name: "Fundamentals of React",
        exercises: 10,
        id: 1
      },
      { 
        name: "Using props to pass data",
        exercises: 7,
        id: 2
      },
      {
        name: "Start of a component",
        exercises: 14,
        id: 3
      }
    ]
  }
  return (
    <div>
      <Course course={course}/>
      {course.parts.map(part => <p>{part.name} {part.exercises}</p>)}
    </div>
  )
}

const Total = (props) => {
  console.log(props)
  return (
    <>
      <p>Number of exercises {props.exercises[0].exercises + props.exercises[1].exercises + props.exercises[2].exercises}</p>
    </>
  )
}

export default App;
